import './App.css';

import Header from './Components/HeadSection';
import Home from './Components/Home';
import Products from './Components/Products';
import AboutUs from './Components/AboutUs';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Products />
      <AboutUs />
      <Footer />
    </div>
  );
}

export default App;
